static inline float processSample(float x) noexcept {
    const float ax = std::fabs(x);
    const float s  = (x < 0.0f) ? -1.0f : 1.0f;

    if (ax >= kXMax) return s * kFullRangeLut.back();

    const float t = ax * ((kLutSize - 1) / kXMax);
    int i0 = (int)t;
    if (i0 < 0) i0 = 0;
    if (i0 > kLutSize - 2) i0 = kLutSize - 2;
    const float frac = t - (float)i0;

    const float y0 = kFullRangeLut[(size_t)i0];
    const float y1 = kFullRangeLut[(size_t)i0 + 1];
    const float y  = y0 + (y1 - y0) * frac;
    return s * y;
}
